import React from "react";

// reactstrap components
import { Row, Container, Col } from "reactstrap";

function LawnPage() {
  return (
        <Container>
            <Row>
                
            <p >
            Nahata Lawns is spread over a area of 2 Acers which welcomes you embellished with Palm trees and beautifully landscaped grass.
            Delightfully charming lights creates an amazing romantic atmosphere which enlightens the inner lights in everyone.
            It is a perfect location for all priceless memorable occasions, may it be weddings, receptions , parties , exhibitions , corporate events etc.
            Nahata Lawns has a lush green lawn area spread over an area of 22000 square feet and two indoor halls , with a separate outdoor dining or buffet area.
            The inner halls can accommodate 200 guests while the whole premises can hosts more then 1500 guests.
              </p>
            </Row>    
            <Container>
                <Row xs="1" sm="2" md="2">
                    <Col md="4">
                    <img
                  alt="..."
                  className="img1 img-responsive1"
                  src={require("assets/img/Lawnshape.png").default}
                  style={{ width: "100%" }}
                />
               <img
                  alt="..."
                  className="img2 img-responsive"
                  src={require("assets/img/Lawns1.png").default}
                  style={{ width: "70%" }}
                />
                 <img
                  alt="..."
                  className="img3 img-responsive"
                  src={require("assets/img/lawncircle1.png").default}
                  style={{ width: "31%",left:"40%" }}
                />
                <div className="lawnstext">
                  <h6>Wedding,Reception,Parties</h6>
                  <p style={{color:"black"}}>A wedding is a ceremony two people are united in marriage.Wedding traditions and..</p>
                  <span>Read More <i class="fa fa-angle-double-right"></i> </span>
                  </div>
                    
                    </Col>
                    <Col md="8">
                        <h3>Wedding Planning</h3>
                        
                    </Col>

                </Row>
            </Container> 
        
       
        </Container> 
  );
}

export default LawnPage;
